import React from 'react'

const CurrencyRow = (props) => {
    const {
        currencyOptions,
        selectCurrency
    }= props
    return (
        <>
            <input type='number' />

            <select value={selectCurrency} o>
                {currencyOptions.map(option=>(
                <option keys={option} value={option}>{option}</option>

                ))}
            </select>
        </>
    )
}

export default CurrencyRow
